// ----------------------------------------------------------------------
// Time
// ----------------------------------------------------------------------

Fw::Time ActiveOverflowComponentBase ::
  getTime() const
{
  if (this->isConnected_timeGetOut_OutputPort(0)) {
    Fw::Time _time;
    this->timeGetOut_out(0, _time);
    return _time;
  }
  else {
    return Fw::Time(TimeBase::TB_NONE, 0, 0);
  }
}

